// Write your component below!

const devData = [
  { name: "John", age: 23, status: "Junier" },
  { name: "Murray", age: 30, status: "Senior" },
  { name: "Molly", age: 28, status: "Mid" },
];

const App = () => {
  const devData = [
    { name: "John", age: 23, status: "Junier" },
    { name: "Murray", age: 30, status: "Senior" },
    { name: "Molly", age: 28, status: "Mid" },
  ];

  return (
    <div className="body">
      <h1>Our Developers</h1>
      {devData.map((dev) => {
        return (
          <div className="">
            <h3> {dev.status} Developer</h3>
            <div>
              <label>Name:</label>
              <p>{dev.name}</p>
              <label>Age:</label>
              <p>{dev.age}</p>
            </div>
          </div>
        );
      })}
    </div>
  );
};
export default App;
